      <div class="card">
        <h3 id="bag0_0">Tipe - Tipe Kriteria Dasar Fungsi Preferensi</h3>
        <p align="justify">Untuk setiap kriteria, fungsi preferensi menerjemahkan perbedaan antara dua alternatif
          menjadi derajat preferensi mulai dari nol sampai satu. Struktur preferensi PROMETHEE berdasarkan perbandingan
          berpasangan. Semakin kecil nilai deviasi maka semakin kecil nilai preferensinya, semakin besar deviasi semakin
          besar preferensinya. Dalam rangka memfasilitasi pemilihan fungsi preferensi tertentu, <i>Brans dan Vincke</i>,
          mengusulkan <b>6 (enam)</b> tipe dasar sebagai berikut (<code>Brans and Vincke, 1985</code>):</p>
        <ol>
          <li><b>Kriteria Biasa (<i>Usual Criterion</i>)</b>
            <p align="justify">Tipe Usual adalah tipe dasar, yang tidak memiliki nilai threshold atau kecenderungan dan
              tipe ini jarang digunakan. Secara matematis dapat dituiskan dalam notasi berikut:<br>
            </p>
            <div class="row" id="pro_05">
              <div class="col-xs-8 col-sm-9">
                <img
                  src="data:image/png;base64,">
              </div>
              <div class="col-xs-4 col-sm-3 text-right">
                .. [PRO-05]
              </div>
            </div>
            Pada tipe ini dianggap tidak ada beda antara alternatif <code>a</code> dan alternatif <code>b</code> jika
            <code>a=b</code> atau <code>f(a)=f(b)</code> , maka niliai preferensinya benilai 0 (Nol) atau
            <code>P(x)=0</code>. Apabila nilai kriteria pada masing-masing alternatif memiliki nilai berbeda, maka
            pembuat keputusan membuat preferensi mutlak benilai 1 (Satu) atau <code>P(x)=1</code> untuk alternatif yang
            memiliki nilai lebih baik.<p align="justify"></p>
            <div class="row" id="pic1">
              <div style="margin:auto;text-align:center;">
                <img
                  src="data:image/png;base64,">
                <br>Gambar 1 : <i>Usual Criterion</i>
              </div>
            </div>
          </li>
          <li><b>Kriteria Quasi (<i>Quasi Criterion</i> atau <i>U-Shape</i>)</b>
            <p align="justify">Tipe Quasi sering digunakan dalam penilaian suatu data dari segi kwalitas atau mutu, yang
              mana tipe ini menggunakan Satu threshold atau kecenderungan yang sudah ditentukan, dalam kasus ini
              threshold itu adalah <i>indifference</i>. Indifference ini biasanya dilambangkan dengan karakter
              <code>m</code> atau <code>q</code>, dan nilai indifference harus diatas 0 (Nol). <br>
            </p>
            <div class="row" id="pro_06">
              <div class="col-xs-8 col-sm-9">
                <img
                  src="data:image/png;base64,">
              </div>
              <div class="col-xs-4 col-sm-3 text-right">
                .. [PRO-06]
              </div>
            </div>
            Suatu alternatif memiliki nilai preferensi yang sama penting selama selisih atau nilai <code>P(x)</code>
            dari masing-masing alternatif tidak melebihi nilai threshold. Apabila selisih hasil evaluasi untuk
            masing-masing alternatif melebihi nilai <code>m</code> atau <code>q</code> maka terjadi bentuk preferensi
            mutlak, jika pembuat memutuskan menggunakan kriteria ini, maka <i>decision maker</i> tersebut harus
            menentukan nilai <code>m</code> atau <code>q</code>, dimana nilai ini dapat menjelaskan pengaruh yang
            signifikan dari sutau kriteria.<p align="justify"></p>
            <div class="row">
              <div style="margin:auto;text-align:center">
                <img
                  src="data:image/png;base64,"><br>
                Gambar 2 : <i>Quasi Criterion</i>
              </div>
            </div>
          </li>
          <li><b>Kriteria dengan preferensi Linier (<i>Criterion with Linear Preference</i> atau <i>V-Shape</i>)</b>
            <p align="justify">Tipe Linier acapkali digunakan dalam penilaian dari segi kuantitatif atau banyaknya
              jumlah, yang mana tipe ini juga menggunakan Satu threshold atau kecenderungan yang sudah ditentukan, dalam
              kasus ini threshold itu adalah preference.
            </p>
            <div class="row" id="pro_07">
              <div class="col-xs-8 col-sm-9">
                <img
                  src="data:image/png;base64,">
              </div>
              <div class="col-xs-4 col-sm-3 text-right">
                .. [PRO-07]
              </div>
            </div>
            Preference ini biasanya dilambangkan dengan karakter <code>n</code> atau <code>p</code>, dan nilai
            preference harus diatas 0 (Nol). Kriteria ini menjelaskan bahwa selama nilai selisih memiliki nilai yang
            lebih rendah dari <code>n</code> atau <code>p</code>, maka nilai preferensi dari pembuat keputusan meningkat
            secara linier dengan nilai x, jika nilai x lebih besar dibandingkan dengan nilai <code>n</code> atau
            <code>p</code>, maka terjadi preferensi mutlak. <p align="justify"></p>
            <div class="row">
              <div style="margin:auto;text-align:center;">

                <img
                  src="data:image/png;base64,">
                <br>
                Gambar 3 : <i>Linear Criterion</i>
              </div>
            </div>
          </li>
          <li><b>Kriteria dengan preferensi Linier dan area yang tidak berbeda -- Linear Quasi (<i>Criterion with Linear
                Preference and Indifference Area</i>)</b>
            <p align="justify">Tipe Linear Quasi juga mirip dengan tipe Linear yang acapkali digunakan dalam penilaian
              dari segi kuantitatif atau banyaknya jumlah. Tipe ini juga menggunakan threshold <i>preference</i>
              (<code>n</code> atau <code>p</code>) tetapi ditambahkan Satu threshold lagi yaitu <i>indifference</i>
              (<code>m</code> atau <code>q</code>).</p>
            <div class="row" id="pro_08">
              <div class="col-xs-8 col-sm-9">
                <img
                  src="data:image/png;base64,">
              </div>
              <div class="col-xs-4 col-sm-3 text-right">
                .. [PRO-08]
              </div>
            </div>
            <p align="justify">Nilai indifference serta preference harus diatas 0 (Nol) dan nilai indifference harus di
              bawah nilai preference. Pengambilan keputusan mempertimbangkan peningkatan preferensi secara linier dari
              tidak berbeda hingga preferensi mutlak dalam area antara dua kecenderungan <code>m</code> dan
              <code>n</code> (atau <code>q</code> dan <code>p</code>)</p>
            <div class="row">
              <div style="margin:auto;text-align:center">

                <img
