                <br>Gambar 4 : <i>Linear Quasi Criterion</i>
              </div>
            </div>
          </li>
          <li><b>Kriteria Level (<i>Level Criterion</i>)</b>
            <p align="justify">Tipe ini mirip dengan tipe Quasi yang sering digunakan dalam penilaian suatu data dari
              segi kwalitas atau mutu. Tipe ini juga menggunakan threshold indifference (<code>m</code> atau
              <code>q</code>) tetapi ditambahkan Satu threshold lagi yaitu preference (<code>n</code> atau
              <code>p</code>).</p>
            <p align="justify">
            </p>
            <div class="row" id="pro_09">
              <div class="col-xs-8 col-sm-9">
                <img
                  src="data:image/png;base64,">
              </div>
              <div class="col-xs-4 col-sm-3 text-right">
                .. [PRO-09]
              </div>
            </div>
            <p align="justify">Nilai indifference serta preference harus diatas 0 (Nol) dan nilai indifference harus di
              bawah nilai preference. Apabila alternatif tidak memiliki perbedaan (x), maka nilai preferensi sama dengan
              0 (Nol) atau <code>P(x)=0</code>. Jika x berada diatas nilai <code>m</code>(atau <code>q</code>) dan
              dibawah nilai <code>n</code>(atau <code>p</code>), hal ini berarti situasi preferensi yang lemah
